import { getSatelliteName } from "tle.js";

export default function generateIDs(tle){

  switch(tle) {
    case 'OneWeb':
      var tleUsed = tleOneWeb;
      break;
    case 'Starlink':
      var tleUsed = tleStarlink;
      break;
    case 'ActiveGeo':
      var tleUsed = tleActiveGeo;
      break;
    case 'Iridium':
      var tleUsed = tleIridium;
    break;
    case 'Intelsat':
      var tleUsed = tleIntelsat;
    break;
    case 'Molniya':
      var tleUsed = tleMolniya;
    break;
    case 'Stations':
      var tleUsed = tleStations;
    break;
    case 'Science':
      var tleUsed = tleScience;
    break;
    default:
      var tleUsed = tleOneWeb;
  }

var splittedtles=tleUsed.split('\n');
var splitted3tles=[];
var tleIDs = [];

for (let i = 0; i < (splittedtles.length/3); i++) {
  
  splitted3tles[i]=splittedtles[i*3]+ '\n' +
  splittedtles[i*3+1]+'\n'+
  splittedtles[i*3+2];

  (splittedtles[i*3+1].substring(2,1)==='0')?((splittedtles[i*3+1].substring(2,2)==='00')?
  (tleIDs.push(splittedtles[i*3+1].substring(4,7))
  ):(tleIDs,push(splittedtles[i*3+1].substring(3,7)))
  ):(tleIDs.push(splittedtles[i*3+1].substring(2,7)))
  }
  return(tleIDs)
}